    <List {...props}>
        <Datagrid rowClick="edit">
            <TextField source="id" />
            <TextField source="bairro" />
            {/*<TextField source="cliente.id" />*/}
            {/*<TextField source="cliente.nome" />*/}
            {/*<EmailField source="cliente.email" />*/}
        </Datagrid>
    </List>
);
